import React from "react";
import { NavLink } from "react-router-dom";
import "./Nav.css";

function Nav() {
  const style = { color: "red", fontWeight: "bold" };
  return (
    <>
      <nav className="nav">
        <NavLink activeStyle={style} className={`NavLink ${activeStyle ? 'activeStyle':''}`} to="/" exact>
          <i className="fas fa-house-user"></i>
          Home
        </NavLink>
        <NavLink activeStyle={style} className="NavLink" to="/skill">
          <i className="fas fa-star-half-alt"></i> Skill
        </NavLink>
        <NavLink activeStyle={style} className="NavLink" to="/projects">
          <i className="fas fa-code"></i> Projects
        </NavLink>
        <NavLink activeStyle={style} className="NavLink" to="/contact">
          <i className="far fa-address-card"></i>Contact
        </NavLink>
      </nav>
    </>
  );
}

export default Nav;
